  var report_name = 'Mental status-dependent airway maneuver'
  var definition = 'GCS total < 8 OR AVPU=(P OR U) AND EU Procedures ≠ Endotracheal intubation, Surgical airway, OR Assisted Ventilation'
  // -----------------------------------------------------
  // Display CaseID IF GCStotal<8 OR AVPU=(P OR U) AND EU Procedures ≠ Endotracheal intubation OR Surgical airway OR Assisted Ventilation
  //
  console.log(report_name)
  // pull some things out of the main dhis2 window
  var date = dhis2.report.date;
  var orgUnit = dhis2.report.organisationUnit;
