  //var period=date.substring(0,4)+"Q" + Math.ceil(Number(String(date.substring(5,7)))/3); Aarons old version, new defined below
  var period = dhis2.report.periods[0];

  var eu_r = $.get(event_query_uri(orgUnit, period, "&dimension=AAkZm4ZxFw7&dimension=AlkbwOe8hCK:IN:2;3;5&stage=NliaouB66pN"));
  var gcs_r = $.get(event_query_uri(orgUnit, period, "&dimension=WJE7ozQ21LA&dimension=kj3SOKykiDg&dimension=AAkZm4ZxFw7&stage=f5JCFeFc6fM"))
  $.when(gcs_r, eu_r).done(function(gcs_avpu, eu_procedures) {

    // this currently will fail if we don't find the right column...
    var gcs = find_col_ind(gcs_avpu, 'WJE7ozQ21LA');
    var avpu = find_col_ind(gcs_avpu, 'kj3SOKykiDg');
    var reg = find_col_ind(gcs_avpu, 'AAkZm4ZxFw7');

    // Check for GSCt < 8 or AVPU == 3,4
    var ids = []
    var rows = gcs_avpu[0].rows;
    for (var i = 0; i < rows.length; i++) {
      if (rows[i][gcs] < 8 || [3,4].includes(rows[i][avpu]) ) {
        ids.push(rows[i][reg])
      }
    }
    report_matched(ids, 'Matched GCSt and AVPU IDs: ')

    // EU Procedure IDs
    // Similar to other audits, this returns procedures where the patient actually
    // received the proper treatement.  We need to now filter these out of the other
    // array of ids for GCSt and AVPU
    var eu_prod_ids = strip_col_val(eu_procedures, 'AAkZm4ZxFw7')

    // Unique ids
    report_matched(eu_prod_ids, "EU Procedures IDs: ")

    matched_ids = filter_array(ids, eu_prod_ids)
    report_matched(matched_ids, 'Filtered Matched: ')

    // Update the actual doc we're viewing

